        "def reduce_dimensions_with_pca(embeddings, n_components):\n",
        "    pca = PCA(n_components=n_components)\n",
        "    reduced_embeddings = pca.fit_transform(embeddings)\n",
        "    return pca, reduced_embeddings\n",
        "\n",
        "def apply_pca_to_test_embeddings(pca, test_embeddings):\n",
        "    return pca.transform(test_embeddings)\n",
        "\n",
        "def evaluate_logistic_regression_on_reduced_data(train_embeddings, train_labels, test_embeddings, test_labels):\n",
        "    model = LogisticRegression(max_iter=1000)\n",
        "    model.fit(train_embeddings, train_labels)\n",
        "\n",
        "    test_predictions = model.predict(test_embeddings)\n",
        "\n",
        "    accuracy = accuracy_score(test_labels, test_predictions)\n",
        "\n",
        "    return accuracy\n",
        "\n",
        "feature_lengths = range(10, 768, 10)\n",
        "\n",
        "accuracies = []\n",
        "\n",
        "print(\"Running logistic regression over various PCA-reduced feature lengths...\")\n",
        "for n_features in tqdm(feature_lengths):\n",
        "    pca, pca_train_embeddings = reduce_dimensions_with_pca(train_embeddings, n_features)\n",
        "\n",
        "    pca_test_embeddings = apply_pca_to_test_embeddings(pca, test_embeddings)\n",
        "\n",
        "    accuracy = evaluate_logistic_regression_on_reduced_data(\n",
        "        pca_train_embeddings, train_labels, pca_test_embeddings, test_labels\n",
        "    )\n",
        "\n",
        "    accuracies.append(accuracy)"
